metadata.prompt:
Extract all relevant information from this document.
        Return the data in valid JSON format. For each extracted field, include:
        - The field value
        - A confidence score between 0 and 1


        Example format:
        {
          "field_name": {
            "value": "extracted value",
            "confidence": 0.95
          },
          "nested_field": {
            "sub_field": {
              "value": "nested value",
              "confidence": 0.8
            }
          },
          "array_field": [
            {
              "value": "item 1",
              "confidence": 0.9
            },
            {
              "value": "item 2",
              "confidence": 0.85
            }
          ]
        }
